DECLARE @ConexionServidor AS NVARCHAR(400)
DECLARE @AndroidUrl AS NVARCHAR(400)
DECLARE @FtpAndroidDir AS NVARCHAR(400)
DECLARE @SitioSubDominio AS NVARCHAR(400)
DECLARE @QuantityOfSitesWithName AS INT

DECLARE
	curConexionServidores
	CURSOR FOR SELECT
	 [ConexionServidor],
	 [AndroidUrl],
	 [FtpAndroidDir],
	 [SitioSubDominio]
	FROM
	 ClientesLicencias
 
OPEN curConexionServidores
FETCH NEXT FROM curConexionServidores INTO @ConexionServidor,@AndroidUrl, @FtpAndroidDir, @SitioSubDominio

WHILE @@FETCH_STATUS = 0
BEGIN

    IF @ConexionServidor IS NOT NULL
	BEGIN
		SELECT @QuantityOfSitesWithName = COUNT(*) from Sitios WHERE Url = @ConexionServidor
		IF @QuantityOfSitesWithName = 0 
		BEGIN
			INSERT INTO Sitios (Url, Descripcion, CreatedDate, UpdatedDate) VALUES (@ConexionServidor, @ConexionServidor, GETDATE(), GETDATE())
		END
	END

	IF @AndroidUrl IS NOT NULL
	BEGIN
		SELECT @QuantityOfSitesWithName = COUNT(*) from Sitios WHERE Url = @AndroidUrl
		IF @QuantityOfSitesWithName = 0 
		BEGIN
			INSERT INTO Sitios (Url, Descripcion, CreatedDate, UpdatedDate) VALUES (@AndroidUrl, @AndroidUrl, GETDATE(), GETDATE())
		END
	END

	IF @FtpAndroidDir IS NOT NULL
	BEGIN
		SELECT @QuantityOfSitesWithName = COUNT(*) from Sitios WHERE Url = @FtpAndroidDir
		IF @QuantityOfSitesWithName = 0 
		BEGIN
			INSERT INTO Sitios (Url, Descripcion, CreatedDate, UpdatedDate) VALUES (@FtpAndroidDir, @FtpAndroidDir, GETDATE(), GETDATE())
		END
	END

	IF @SitioSubDominio IS NOT NULL
	BEGIN
		SELECT @QuantityOfSitesWithName = COUNT(*) from Sitios WHERE Url = @SitioSubDominio
		IF @QuantityOfSitesWithName = 0 
		BEGIN
			INSERT INTO Sitios (Url, Descripcion, CreatedDate, UpdatedDate) VALUES (@SitioSubDominio, @SitioSubDominio, GETDATE(), GETDATE())
		END
	END

	FETCH NEXT FROM curConexionServidores INTO @ConexionServidor,@AndroidUrl, @FtpAndroidDir, @SitioSubDominio
END

CLOSE curConexionServidores
DEALLOCATE curConexionServidores

