DECLARE @ConexionServidor AS NVARCHAR(400)
DECLARE @AndroidUrl AS NVARCHAR(400)
DECLARE @FtpAndroidDir AS NVARCHAR(400)
DECLARE @SitioSubDominio AS NVARCHAR(400)
DECLARE @ClienteLicenciaId AS INT
DECLARE @IdToInsert AS INT

DECLARE
	curConexionServidores
	CURSOR FOR SELECT
	 [Id],
	 [ConexionServidor],
	 [AndroidUrl],
	 [FtpAndroidDir],
	 [SitioSubDominio]
	FROM
	 ClientesLicencias
 
OPEN curConexionServidores
FETCH NEXT FROM curConexionServidores INTO @ClienteLicenciaId,@ConexionServidor,@AndroidUrl, @FtpAndroidDir, @SitioSubDominio

WHILE @@FETCH_STATUS = 0
BEGIN

    IF @ConexionServidor IS NOT NULL
	BEGIN
		SELECT @IdToInsert = Id from Sitios WHERE Url = @ConexionServidor
		UPDATE
			ClientesLicencias
			SET [ConexionServidorId] = @IdToInsert
			WHERE [Id] = @ClienteLicenciaId
	END

	IF @AndroidUrl IS NOT NULL
	BEGIN
		SELECT @IdToInsert = Id from Sitios WHERE Url = @AndroidUrl
		UPDATE
			ClientesLicencias
			SET [AndroidUrlId] = @IdToInsert
			WHERE [Id] = @ClienteLicenciaId
	END

	IF @FtpAndroidDir IS NOT NULL
	BEGIN
		SELECT @IdToInsert = Id from Sitios WHERE Url = @FtpAndroidDir
		UPDATE
			ClientesLicencias
			SET [FtpAndroidDirId] = @IdToInsert
			WHERE [Id] = @ClienteLicenciaId
	END

	IF @SitioSubDominio IS NOT NULL
	BEGIN
		SELECT @IdToInsert = Id from Sitios WHERE Url = @SitioSubDominio
		UPDATE
			ClientesLicencias
			SET [SitioSubDominioId] = @IdToInsert
			WHERE [Id] = @ClienteLicenciaId
	END

	FETCH NEXT FROM curConexionServidores INTO @ClienteLicenciaId,@ConexionServidor,@AndroidUrl, @FtpAndroidDir, @SitioSubDominio
END

CLOSE curConexionServidores
DEALLOCATE curConexionServidores

